import { Component, Vue, Prop } from 'vue-property-decorator';

@Component({
    props: {
        noNav: {
            type: Boolean,
            required: false,
            default: false
        },
        noTab: {
            type: Boolean,
            required: false,
            default: false
        }
    }
})
export default class ContentContainer extends Vue {
}
